import React from 'react';
import Modal from './Modal';

class Jenn extends React.Component{
  render(){
    return(
      <Modal
          title="Jennifer Parent-Nichols "
          content= {this.renderForm()}
          onDismiss={() => history.push('/blog')}
      />
    );
  }
}

export default Jenn;
